    for i in range(len(a)):
        for j in range(i + 1, len(a)):
            if gcd(a[i], a[j]) < min_gcd:
                min_gcd = gcd(a[i], a[j])
                min_i = i + 1
                min_j = j + 1
    print(min_i, min_j)

if __name__ == '__main__':
